import React, { Component } from "react";
import {
  Col,
  Container,
  Row,
  Card,
  CardImg,
  CardBody,
  CardTitle,
  CardSubtitle,
  CardText,
  Button,
  NavItem,
  NavLink,
} from "reactstrap";
import ItemLibrary from "../components/ItemLibrary";

const Library = (props) => {
  const FavoriteComponent = props.FavoriteComponent;
  return (
    <div>
      <Container>
        <Row>
          <Col xs="3">
            <ItemLibrary />
            <FavoriteComponent/>
          </Col>
        </Row>
      </Container>
    </div>
  );
};
export default Library;
